"use strict";

const { default: defaultdict } = require("defaultdict");

function f_gold(pid, ppid, kill) {
    function dfs(u) {
        ans.push(u);
        for (let v of g[u]) {
            dfs(v);
        }
    }

    const g = new defaultdict(Array);
    const n = pid.length;
    for (let i = 0; i < n; i++) {
        g[ppid[i]].push(pid[i]);
    }
    const ans = [];
    dfs(kill);
    return ans;
}
